import React from "react";
import { Routes, Route,NavLink } from "react-router-dom";
import "./Nav.css";
import About from "./About";
import Contact from "./Contact";
import Services from "./Services.jsx";
import Home from "./Home";
import Blog from "./Blogs";
const NavBar=()=>{
    return (
        <>
        <header className="header">
            <div className="logo-section"><span>Devesh Mishra</span></div>
            <nav className="navbar">
                <ul className="nav-items-list">
                    <li className="nav-items"><NavLink to="/">Home</NavLink></li>
                    <li className="nav-items"><NavLink to="/About">About</NavLink></li>
                    <li className="nav-items"><NavLink to="/Contact">Contact</NavLink></li>
                    <li className="nav-items"><NavLink to="Services">Services</NavLink></li>
                </ul>
            </nav>
        </header>


        <Routes>
            <Route path="/" Component={Home}></Route>
            <Route path="/Contact" Component={Contact}></Route>
            <Route path="/About" Component={About}></Route>
            <Route path="Services" Component={Services}></Route>
        </Routes>
        </>
    )
}
export default NavBar;
